import * as React from "react";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import TopBar from "./TopBar";

export default function QuestionPage(props) {
  return (
    <div>
      <TopBar />
      {props.icon}
      <Typography variant="h5" component="div" gutterBottom>
        {props.question}
      </Typography>
      <Button
        sx={{ margin: 1 }}
        onClick={(event) => {
          props.setCurrentPage(props.currentPage + "T");
        }}
        size="large"
        variant="contained"
      >
        Yes
      </Button>
      <Button
        sx={{ margin: 1 }}
        onClick={(event) => {
          props.setCurrentPage(props.currentPage + "F");
        }}
        size="large"
        variant="contained"
      >
        No
      </Button>
    </div>
  );
}
